package LoopingStatement;

public class Nestedforloop15patternprogram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int x=5;
		
		for(int i=1;i<=x;i++)
		{
			for(int j=1;j<=x;j++)
			{
				System.out.print( i );
			}
			System.out.println();
		}

	}

}
